import React from "react";

const Root = () => {
    return (
        <div className="w-screen h-screen font-sans">
            <div className="flex flex-col space-y-2 w-1/4 h-1/4 px-6 py-4">
                <p className="font-bold text-2xl">VKV RESTAURATIES</p>
                <div className="flex justify-between w-3/4">
                    <div className="flex flex-col">
                        <p>PROJECTS</p>
                        <p>ABOUT ME</p>
                    </div>
                    <div className="flex flex-col">
                        <p>MAP</p>
                        <p>CONTACT</p>
                    </div>
                </div>
            </div>

        </div>
    );
}

export default Root;
